import React, { useState } from "react";
import { toast } from "react-toastify";
import { registerApi } from "../apis/Api";
import { useNavigate, Link } from "react-router-dom";
import { z } from "zod";

const Register = () => {
  const navigate = useNavigate();
  const [UserName, setUserName] = useState("");
  const [email, setEmail] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setconfirmPassword] = useState("");

  const [errors, setErrors] = useState({});

  const clearError = (field) => {
    setErrors((prevErrors) => ({ ...prevErrors, [field]: "" }));
  };

  const changeUserName = (e) => {
    setUserName(e.target.value);
    clearError("UserName");
  };
  const changeEmail = (e) => {
    setEmail(e.target.value);
    clearError("email");
  };
  const changePhoneNumber = (e) => {
    setPhoneNumber(e.target.value);
    clearError("phoneNumber");
  };
  const changePassword = (e) => {
    setPassword(e.target.value);
    clearError("password");
  };
  const changeconfirmPassword = (e) => {
    setconfirmPassword(e.target.value);
    clearError("confirmPassword");
  };

  // Define the Zod validation schema
  const schema = z
    .object({
      UserName: z.string().min(1, { message: "Name is required" }),
      email: z.string().min(1, { message: "Email is required" }),
      phoneNumber: z.string().min(1, { message: "Phone number is required" }),
      password: z.string().min(1, { message: "Password is required" }),
      confirmPassword: z
        .string()
        .min(1, { message: "Confirm Password is required" }),
    })
    .superRefine((data, ctx) => {
      if (data.UserName.length === 0) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Name is required",
          path: ["UserName"],
        });
      } else if (!/^[A-Za-z\s]+$/.test(data.UserName)) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Name cannot contain special characters or numbers",
          path: ["UserName"],
        });
      }
      if (data.email.length === 0) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Email is required",
          path: ["email"],
        });
      } else if (!/\S+@\S+\.\S+/.test(data.email)) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Invalid email format",
          path: ["email"],
        });
      }

      if (data.phoneNumber.length === 0) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Phone number is required",
          path: ["phoneNumber"],
        });
      } else if (!/^\d{10}$/.test(data.phoneNumber)) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Phone number must be 10 digits",
          path: ["phoneNumber"],
        });
      }

      if (data.password.length === 0) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Password is required",
          path: ["password"],
        });
      } else if (data.password.length < 8) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Password must be at least 8 characters long",
          path: ["password"],
        });
      }

      if (data.confirmPassword.length === 0) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Confirm Password is required",
          path: ["confirmPassword"],
        });
      } else if (data.password !== data.confirmPassword) {
        ctx.addIssue({
          code: z.ZodIssueCode.custom,
          message: "Passwords do not match",
          path: ["confirmPassword"],
        });
      }
    });

  const handleSubmit = (e) => {
    e.preventDefault();

    const data = {
      UserName,
      email,
      phoneNumber,
      password,
      confirmPassword,
    };

    // Validate form data using Zod schema
    const result = schema.safeParse(data);
    if (!result.success) {
      const newErrors = {};
      result.error.errors.forEach((err) => {
        console.log(err);
        newErrors[err.path[0]] = err.message;
      });
      setErrors(newErrors);
      return;
    }

    setErrors({}); // Clear errors if validation passes

    registerApi(data)
      .then((res) => {
        if (res.data.success === true) {
          toast.success(res.data.message);
          navigate("/login");
        } else {
          toast.error(res.data.message);
        }
      })
      .catch((err) => {
        console.log(err);
        toast.error("Internal Server Error!");
      });
  };
  return (
    <>
      <section class="row min-vh-100 align-items-center">
        <div class="container py-5 d-flex justify-content-center">
          <div class="col col-md-10 col-sm-12 col-lg-8 fixed-container">
            <div class="card d-flex align-items-center shadow-lg">
              <div class="row">
                <div class="col-md-6 col-lg-6 order-md-1 order-lg-1 mb-4">
                  <img
                    src="https://i.pinimg.com/564x/a7/dd/af/a7ddaf4475ec3822a9b8aebb2956e253.jpg"
                    alt="register image"
                    class="img-fluid"
                    style={{ marginTop: "100px" }}
                  />
                </div>
                <div>
                  <a
                    className="position-absolute top-0 end-0 m-2 text-black"
                    style={{ cursor: "pointer" }}
                    onClick={() => navigate("/")}
                  >
                    <FontAwesomeIcon icon={faClose} />
                  </a>
                </div>

                <div className="col-md-6 col-lg-6 order-lg-3 d-flex align-items-center">
                  <div className="card-body p-5 p-lg-5 text-black">
                    <form>
                      <div class="mb-4 d-flex justify-content-center">
                        <i class="fas fa-cubes fa-2x me-2"></i>
                      </div>

                      <h3 class="fw-bold d-flex justify-content-center">
                        Register
                      </h3>

                      {/* Username */}
                      <div class="form-outline mb-2">
                        <label class="form-label">Username</label>
                        <input
                          onChange={changeUserName}
                          type="text"
                          class="form-control form-control-lg border-2 border-black"
                        />
                      </div>
                      {/* Email */}
                      <div class="form-outline mb-2">
                        <label class="form-label">Email address</label>
                        <input
                          onChange={changeEmail}
                          type="email"
                          class="form-control form-control-lg border-2 border-black"
                        />
                      </div>
                      {/* Phone Number */}
                      <div class="form-outline mb-2">
                        <label class="form-label">Phone Number</label>
                        <input
                          onChange={changePhoneNumber}
                          type="number"
                          class="form-control form-control-lg border-2 border-black"
                        />
                      </div>

                      {/* Password */}
                      <div class="form-outline mb-2">
                        <label class="form-label ">Password</label>
                        <input
                          onChange={changePassword}
                          type="password"
                          class="form-control form-control-lg border-2 border-black w-full"
                        />
                      </div>
                      {/* Confirm Password */}
                      <div class="form-outline mb-2">
                        <label class="form-label">Confirm Password</label>
                        <input
                          onChange={changeconfirmPassword}
                          type="password"
                          class="form-control form-control-lg border-2 border-black"
                        />
                      </div>

                      {/* Register button */}
                      <div class="pt-1 mb-3 d-flex text-center justify-content-center">
                        <button
                          onClick={handleSubmit}
                          className="btn w-50 mb-2 btn btn-dark"
                          type="button"
                        >
                          Register
                        </button>
                      </div>

                      <p class="mb-5 pb-lg-2 d-flex justify-content-center">
                        Already have an account?{" "}
                        <a
                          href="/login"
                          class="text-decoration-none text-black"
                        >
                          Login
                        </a>
                      </p>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Register;
